import * as React from "react";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import Divider from "@mui/material/Divider";
import ListItemText from "@mui/material/ListItemText";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import Avatar from "@mui/material/Avatar";
import Typography from "@mui/material/Typography";
import { Container } from "@mui/material";

import img1 from "../../assets/images/NCT_도영.PNG";
import img2 from "../../assets/images/NCT_제노.PNG";
import img3 from "../../assets/images/스트레이키즈_필릭스.PNG";

export default function ChartList() {
  const visiterList = ["아궁빵뎡", "제노예요", "김필릭스용복"];
  const lastMessageList = [
    "안녕하세요 거래 희망합니다!",
    "혹시 교환 완료되었나요?",
    "저요 제가 아니면 안돼요",
  ];
  const imageList = [img1, img2, img3];
  return (
    <Container>
      <h2>채팅목록</h2>
      <List sx={{ width: "100%", maxWidth: 500 }}>
        {visiterList.map((visitor, index) => (
          <ListItem key={index} alignItems="flex-start">
            <ListItemAvatar>
              <Avatar src={imageList[index]} />
            </ListItemAvatar>
            <ListItemText
              primary={visitor}
              secondary={
                <React.Fragment>
                  <Typography
                    sx={{ display: "inline" }}
                    component="span"
                    variant="body2"
                    color="text.primary"
                  >
                    {lastMessageList[index]}
                  </Typography>
                  {" messageTime"}{" "}
                  {/* messageTime을 여기에 넣거나 따로 계산하여 넣으세요 */}
                </React.Fragment>
              }
            />
          </ListItem>
        ))}
        <ListItem alignItems="flex-start">
          <ListItemAvatar>
            <Avatar src={img2} />
          </ListItemAvatar>
          <ListItemText
            primary="Summer BBQ"
            secondary={
              <React.Fragment>
                <Typography
                  sx={{ display: "inline" }}
                  component="span"
                  variant="body2"
                  color="text.primary"
                >
                  to Scott, Alex, Jennifer
                </Typography>
                {" — Wish I could come, but I'm out of town this…"}
              </React.Fragment>
            }
          />
        </ListItem>
        <Divider variant="inset" component="li" />
        <ListItem alignItems="flex-start">
          <ListItemAvatar>
            <Avatar src={img3} />
          </ListItemAvatar>
          <ListItemText
            primary="Oui Oui"
            secondary={
              <React.Fragment>
                <Typography
                  sx={{ display: "inline" }}
                  component="span"
                  variant="body2"
                  color="text.primary"
                >
                  Sandra Adams
                </Typography>
                {" — Do you have Paris recommendations? Have you ever…"}
              </React.Fragment>
            }
          />
        </ListItem>
      </List>
    </Container>
  );
}
